import React from "react";
import styled from "styled-components";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

function ThirdPage() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 100,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
  };
  return (
    <Container>
      <Carousel {...settings}>
        <Wrap>
          <a>
            <img src="/images/model-s/tesla-steering.jpg" alt="steering" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/screen.jpg" alt="steering" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/seats.jpg" alt="steering" />
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/witcher.jpg" alt="steering" />
          </a>
        </Wrap>
      </Carousel>
    </Container>
  );
}

const Container = styled.div`
  height: 150vh;
  background: rgb(0, 0, 0);
`;

const Carousel = styled(Slider)`
  & > button {
    height: 100%;
    width: 5vw;
    z-index: 1;
  }
  ul li button {
    transform: translate(-250px, 140px);
    border: 1px solid rgb(249, 249, 249);
    border-radius: 50%;
    &:before {
      font-size: 10px;
      color: rgb(150, 150, 171);
    }
  }

  li.slick-active button:before {
    color: white;
  }

  .slick-list {
    overflow: initial;
  }

  .slick-prev {
    left: -75px;
  }

  .slick-next {
    right: -75px;
  }
`;

const Wrap = styled.div`
  transform: translate(100px, 150px);

  position: relative;
  height: 90vh;
  cursor: pointer;

  justify-content: center;
  a {
    border-radius: 1px;
    display: block;
    position: relative;
    padding: 4px;

    img {
      width: 80%;
      height: 100%;
    }
  }
`;
export default ThirdPage;
